import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import './App.css';

// Sidebar Component
function Sidebar() {
  return (
    <div className="sidebar">
      <h2>My Profile</h2>
      <nav>
        <NavLink to="/" end activeclassname="active">Home</NavLink>
        <NavLink to="/projects" activeclassname="active">Projects</NavLink>
        <NavLink to="/about" activeclassname="active">About</NavLink>
        <NavLink to="/contact" activeclassname="active">Contact</NavLink>
      </nav>
    </div>
  );
}

// Pages
function Home() {
  return <div className="page-content"><h1>Home</h1><p>Welcome to my profile!</p></div>;
}

function Projects() {
  return <div className="page-content"><h1>Projects</h1><p>Here are some of my projects.</p></div>;
}

function About() {
  return <div className="page-content"><h1>About</h1><p>About me section content.</p></div>;
}

function Contact() {
  return <div className="page-content"><h1>Contact</h1><p>Contact me at email@example.com.</p></div>;
}

// Main App
function App() {
  return (
    <Router>
      <div className="app-container">
        <Sidebar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
